    return (
        <Router>
          <div>
            <header>
              <Link to="/">Home</Link>
              <Link to="/about">About</Link>
            </header>
            <main>
              <Routes> 
                <Route path="/" element={<HomePage />} />
                <Route path="/about" element={<RecipePage />} />
              </Routes>
            </main>
          </div>
        </Router>
      );
}

export default App;
